import React, { Suspense } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

// const SignInComponent = React.lazy(() => import('./views/loginManager/sign-in/signIn'));
// const DashboardComponent = React.lazy(() => import('./views/dashboard/dashboard'));
import DashboardComponent from './views/dashboard/dashboard'
import SignInComponent from './views/loginManager/sign-in/signIn'

function App() {
  return (
      <Router>
        <div className="Layout">
          <Switch>
            <Route path="web/dashboard">
              <DashboardComponent />
            </Route>
            <Route path="/">
              <SignInComponent />
            </Route>
          </Switch>
        </div>
      </Router>
  );
}

export default App;
